import React from 'react'
import AddButton from './AddButton'
import Header from './Headers'
import ListProducts from './ListProducts'
const ProductLayout = () => {
    
    return (
    <>
    <Header title="Products App"/>
    <AddButton/>
    <ListProducts/>
    </>
    )}

export default ProductLayout
